// Metatable for userdata objects
static const luaL_Reg userdata_metaLib[] = {
    {"__index",    userdata_index},
    {"__pairs",    userdata_pairs},
    {"__tostring", userdata_tostring},
    {"__gc",       userdata_gc},
    {NULL,         NULL}
};

